import CardBook from "../CardBook"

const Waterfall = () => {
    return (
        <div>
            <CardBook
                post={{
                    title: 'title',
                    image: '//aa',
                    type: 0,
                    user: {
                        username: 'username',
                        avatar: '//aa'
                    },
                    count: {
                        likes: 1
                    }
                }}
            />
        </div>
    )
}

export default Waterfall
